import React, {Component} from "react";
class Header extends Component {
    render(){
        return(
        <div class="wrapper">
                <div class="search_box">
                    <input type="text" placeholder="what are you looking for?">
                    <i class="fas fa-search"></i>
                </input>
                </div>
        </div>
    
            );
        }
}
export default Header
